import React from 'react';

const RehabCenter = () => {
  return (
    <div style={{ padding: "2rem" }}>
      <h1>Find the Best Rehab Center</h1>
      <p>Use this page to locate the nearest rehab centers around you.</p>
    </div>
  );
};

export default RehabCenter;
